import React, { useState, useEffect } from 'react';
import './App.css';
import Add from './components/Adding'; // Corrected import path

function App() {
  const [contacts, setContacts] = useState([]);

  useEffect(() => {
    // Fetch data from the backend
    fetch('http://localhost/api/contacts')  // Replace with your actual API URL
      .then(response => response.json())
      .then(data => setContacts(data))
      .catch(error => {
        console.error('Error:', error);
      });
  }, []);  // Empty dependency array to run the effect only once

  return (
    <div style={{ backgroundColor: "#F1EFEF" }}>
      <h1><b>CONTACTOR</b></h1>
      <Add heading="Contact" contacts={contacts} setContacts={setContacts} />
    </div>
  );
}

export default App;
